import React from 'react';
import styled from 'styled-components';

const BoxforEcPickMobile=styled.div`
    width:288px;
    height:216px;
    background: #FFFFFF 0% 0% no-repeat padding-box;
    opacity: 1;
`;


function EcPickBoxforMobile(){
    return <BoxforEcPickMobile />;
}

export default EcPickBoxforMobile;
